(function(){"use strict";function hsfw_getPageUrl(window,document){if(window.parent!==window){return new URL(document.referrer)}else{return new URL(window.location.href)}}function hsfw_formatUrl(pageUrl){var pageProtocol=pageUrl.protocol;var pageHostname=pageUrl.hostname;var pagePathname=pageUrl.pathname;var formattedUrl=pageProtocol+"//"+pageHostname;if(pagePathname!=="/"){formattedUrl+=pagePathname}return formattedUrl}function hsfw_createContainer(document){var container=document.createElement("div");container.id="hopesync_formwidget_container";return container}function hsfw_getReferringPageVariables(window){const searchParams=new URLSearchParams(window.location.search);let params="";for(let[key,value]of searchParams.entries()){params+=key+"="+value+","}return params}function hsfw_isMobileDevice(navigator){return/Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent)}function hsfw_getClientInfo(window,document,navigator){return encodeURIComponent(JSON.stringify({referringSiteURL:window.location.href,referringPageName:window.document.title,previousPage:document.referrer,referringPageVariables:hsfw_getReferringPageVariables(window),deviceScreenSizeSmallerDimension:Math.min(window.screen.width,window.screen.height),deviceScreenSizeLargerDimension:Math.max(window.screen.width,window.screen.height),deviceOS:navigator.platform,deviceBrowser:navigator.userAgent,deviceBrowserVersion:navigator.appVersion,isMobile:hsfw_isMobileDevice(navigator),cookiesAllowed:navigator.cookieEnabled}))}function hsfw_setContainerStyle(container){container.style.width="100%";container.style.height="100%";container.style.zIndex="10000";container.style.backgroundColor="transparent";container.style.overflow="hidden";container.style.display="block";container.style.margin="0";container.style.padding="0";container.style.border="none"}function hsfw_getPageDomain(window){if(window.parent!==window){return window.parent.location.hostname}else{return window.location.hostname}}function hsfw_getSrc(window,hsfw_prod){var clientDomain=hsfw_getPageDomain(window);var qaDomains=["hsformwidget-test.azurewebsites.net","hopesync2.wpcomstaging.com","hopesync.wpcomstaging.com"];var devDomains=["hsformwidget-dev.azurewebsites.net"];if(hsfw_prod){return"https://hsformwidget.azurewebsites.net"}if(qaDomains.includes(clientDomain))return"https://hsformwidget-test.azurewebsites.net";if(devDomains.includes(clientDomain))return"https://hsformwidget-dev.azurewebsites.net";return"https://hsformwidget.azurewebsites.net"}function hsfw_createIframe(document,formId,formattedUrl,clientInfo,window,hsfw_prod){var iframe=document.createElement("iframe");var src=hsfw_getSrc(window,hsfw_prod);iframe.title="hopesync_formwidget_iframe";iframe.src=`${src}/widget.html?formId=${formId}&domain=${formattedUrl}&clientInfo=${clientInfo}&src=${src}`;iframe.style.width="100%";iframe.style.height="100%";iframe.style.border="none";iframe.style.backgroundColor="transparent";return iframe}function hsfw_sendGaMessage(event){event.source.postMessage({hs_gaID:event.data.hs_gaID,hs_gaGTMID:event.data.hs_gaGTMID},"*")}function hsfw_updateGaIframe(event,window){console.info("Updating GA iframe",event.data.hs_gaPageToOpen);const iframe2=window.parent.document.getElementById("hsformwidget-ga-iframe");iframe2.setAttribute("src",event.data.hs_gaPageToOpen)}function hsfw_executeFunction(event,window){const{calledFunction:calledFunction,functionParams:functionParams}=event.data;try{console.info("Proceding to execute: ",calledFunction);if(typeof window[calledFunction]==="function"){window[calledFunction](functionParams)}else if(typeof window.parent[calledFunction]==="function"){window.parent[calledFunction](functionParams)}else{console.warn(`Function ${calledFunction} not found`);return}console.info(`Function ${calledFunction} executed successfully`)}catch(error){console.warn(`An internal error occurred while executing ${calledFunction}:`,error)}}function hsfw_resizeContainer(event,document){const hsfw_height=event.data.hsfw_height;if(hsfw_height){document.getElementById("hopesync_formwidget_container").style.height=200+hsfw_height+"px"}}function handleMessageEvent(event,gaFirstTime,window,document){if((event.data.hs_gaID||event.data.hs_gaGTMID)&&gaFirstTime){hsfw_sendGaMessage(event);gaFirstTime=false}if(event.data.hs_gaPageToOpen){hsfw_updateGaIframe(event,window)}if(event.data.calledFunction){hsfw_executeFunction(event,window)}if(event.data.hsfw_height){hsfw_resizeContainer(event,document)}}function hsfw_addMessageListener(window,document){var gaFirstTime=true;window.addEventListener("message",event=>{handleMessageEvent(event,gaFirstTime,window,document)})}function wix_widget_container_factory(document,window,hsfw_formId,navigator,hsfw_prod){const pageUrl=hsfw_getPageUrl(window,document);const formattedUrl=hsfw_formatUrl(pageUrl);const container=hsfw_createContainer(document);const clientInfo=hsfw_getClientInfo(window,document,navigator);hsfw_setContainerStyle(container);const iframe=hsfw_createIframe(document,hsfw_formId,formattedUrl,clientInfo,window,hsfw_prod);hsfw_addMessageListener(window,document);container.appendChild(iframe);return container}class HelloWorld extends HTMLElement{constructor(){super()}connectedCallback(){var formId=this.getAttribute("formid");this.appendChild(wix_widget_container_factory(document,window,formId,navigator,false))}}customElements.define("hello-world",HelloWorld)})();